uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// --- JSON PARAMETERS ---
uniform float u_speed;          // Orbit Speed
uniform float u_camera_dist;    // Distance
uniform float u_fov;            // Field of View
uniform float u_glow_intensity; // Atmosphere

out vec4 fragColor;

// --- CONSTANTS ---
#define MAX_STEPS 128
#define MAX_DIST 120.0
#define SURF_DIST 0.001
#define PI 3.14159265

// --- TRANSFORMATIONS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum (The "Sticky Liquid" Function)
// Increasing 'k' makes the connection stretchier
float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// Noise for the desert floor
float hash(vec2 p) { return fract(sin(dot(p, vec2(12.9898, 78.233))) * 43758.5453); }
float noise(vec2 p) {
    vec2 i = floor(p); vec2 f = fract(p); f = f * f * (3.0 - 2.0 * f);
    return mix(mix(hash(i + vec2(0, 0)), hash(i + vec2(1, 0)), f.x),
               mix(hash(i + vec2(0, 1)), hash(i + vec2(1, 1)), f.x), f.y);
}

// --- SDF SHAPES ---
float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

float sdSphere(vec3 p, float r) {
    return length(p) - r;
}

// --- THE SURREAL MAP ---
float map(vec3 p) {
    float t = iTime * u_speed;

    // 1. The Cracked Desert Floor
    float n = noise(p.xz * 3.0);
    float cracks = smoothstep(0.4, 0.5, n);
    float ground = p.y + 3.0 + n * 0.2;

    // 2. The Liquid Core (Sphere)
    // It sits in the center
    float core = sdSphere(p, 1.5);

    // 3. The Orbiting Anchors (Cubes)
    // We create 4 cubes that orbit on different axes
    float dAnchors = 100.0;

    for(float i=0.0; i<4.0; i++) {
        // Offset time for each cube so they are spaced out
        float timeOffset = t + (i * PI / 2.0);

        // Calculate orbit position
        // A complex orbit: XZ circle + vertical bobbing
        vec3 pos = vec3(cos(timeOffset)*3.5, sin(timeOffset*2.0)*1.5, sin(timeOffset)*3.5);

        // Rotate the box itself
        vec3 boxP = p - pos;
        boxP.xz *= rot(t * 2.0);
        boxP.xy *= rot(t);

        float box = sdBox(boxP, vec3(0.5));

        // Accumulate distance (Union)
        dAnchors = min(dAnchors, box);
    }

    // 4. The Gravitational Pull (Blending)
    // We blend the Core and the Anchors with a large K value (1.2)
    // This creates the "web" or "taffy" effect connecting them
    float liquidObj = smin(core, dAnchors, 1.2);

    // Combine with ground
    return min(ground, liquidObj);
}

// --- RAYMARCHING ---
vec3 getNormal(vec3 p) {
    float d = map(p);
    vec2 e = vec2(0.005, 0.0);
    vec3 n = d - vec3(map(p - e.xyy), map(p - e.yxy), map(p - e.yyx));
    return normalize(n);
}

float softShadow(vec3 ro, vec3 rd, float k) {
    float res = 1.0;
    float t = 0.05;
    for(int i = 0; i < 32; i++) {
        float h = map(ro + rd * t);
        res = min(res, k * h / t);
        if(res < 0.001) break;
        t += clamp(h, 0.02, 0.5);
    }
    return clamp(res, 0.0, 1.0);
}

void main() {
    // 1. SETUP
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 screenUV = gl_FragCoord.xy / iResolution.xy;
    float time = iTime * u_speed;

    // 2. CAMERA (Slow orbit)
    float camDist = max(u_camera_dist, 8.0);
    float angle = time * 0.1;

    vec3 ro = vec3(sin(angle) * camDist, 2.0, cos(angle) * camDist);
    vec3 ta = vec3(0.0, 0.0, 0.0);

    vec3 fwd = normalize(ta - ro);
    vec3 right = normalize(cross(vec3(0, 1, 0), fwd));
    vec3 up = cross(fwd, right);
    vec3 rd = normalize(fwd * max(u_fov, 0.7) + uv.x * right + uv.y * up);

    // 3. RENDER LOOP
    float t = 0.0;
    float d = 0.0;

    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * t;
        d = map(p);
        if(abs(d) < SURF_DIST || t > MAX_DIST) break;
        t += d * 0.7;
    }

    // 4. SHADING
    // Dal Sky: Surreal Green/Blue transition
    vec3 bgCol = mix(vec3(0.2, 0.6, 0.5), vec3(0.0, 0.1, 0.2), screenUV.y);
    vec3 col = bgCol;

    if(t < MAX_DIST) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 ref = reflect(rd, n);
        vec3 lightDir = normalize(vec3(0.5, 0.8, -0.5));

        float dif = clamp(dot(n, lightDir), 0.0, 1.0);
        float sha = softShadow(p + n * 0.02, lightDir, 12.0);
        float fresnel = pow(clamp(1.0 + dot(rd, n), 0.0, 1.0), 4.0);

        // --- MATERIAL LOGIC ---
        // We separate the anchors (cubes) from the liquid core based on distance from center
        float distFromCenter = length(p);

        if (p.y < -2.0) {
            // -- FLOOR --
            vec3 sand = vec3(0.8, 0.6, 0.4);
            // Apply noise texture
            float txt = noise(p.xz * 5.0);
            sand *= 0.5 + 0.5 * txt;
            col = sand * dif * sha;

        } else if (distFromCenter > 2.5) {
            // -- ANCHORS (Matte Black/Obsidian) --
            // These are the blocks pulling the liquid
            vec3 obsidian = vec3(0.05, 0.05, 0.05);
            col = obsidian * dif;
            col += vec3(1.0) * pow(dif, 32.0); // Sharp highlight

        } else {
            // -- LIQUID CORE (Chrome) --
            vec3 chrome = vec3(0.1);

            // Image Reflection
            vec3 refTex = texture(iChannel0, ref.xy * 0.5 + 0.5).rgb;
            refTex = pow(refTex, vec3(1.4)) * 1.5;

            chrome += refTex * 0.8;
            chrome += fresnel * vec3(0.0, 1.0, 1.0); // Cyan rim light (Sci-fi touch)
            chrome += vec3(1.0, 0.9, 0.8) * pow(dif, 16.0); // Sun spec

            col = chrome;
        }
    }

    // 5. POST PROCESS
    // Fog
    float fog = 1.0 - exp(-t * 0.02);
    vec3 fogCol = vec3(0.4, 0.5, 0.5) * u_glow_intensity;
    col = mix(col, fogCol, fog);

    // Gamma
    col = pow(col, vec3(0.4545));

    // Cinematic Vignette
    col *= 0.5 + 0.5 * pow(16.0 * screenUV.x * screenUV.y * (1.0 - screenUV.x) * (1.0 - screenUV.y), 0.2);

    fragColor = vec4(col, 1.0);
}
